def enumerated_fields(machine, field_prefix):
    res = [
        Feature(as_obj={
            '_id': '{}_CONNECT_REPONSE_ID'.format(field_prefix),
            '_type': 'MACHINE',
            'expansion_safe': True,
            'value': get_field(machine,
                               '{}_connect_response_connect_id'.format(field_prefix),
                               t='int'),
            'description': 'connect id value for {}?'.format(field_prefix)
        })
    ]
    res += list_of_bool_int_fields(machine,
                                   parent_field='{}_connect_response_domain_parameters'.format(field_prefix),
                                   child_fields=domain_params,
                                   description='domain param value')

    res += list_of_bool_int_fields(machine,
                                   parent_field='{}_selected_security_protocol'.format(field_prefix),
                                   child_fields=sec_protocols,
                                   description='sec protocol value')

    res += list_of_bool_int_fields(machine,
                                   parent_field='{}_protocol_supported_flags'.format(field_prefix),
                                   child_fields=supported_flags,
                                   description='supported flag value')

    return res


def meta_features(machine, field_prefix):
    res = []
    res += list_of_bool_int_fields(machine,
                                   parent_field=field_prefix,
                                   child_fields=[
                                       'supported',
                                       'version_major',
                                       'version_minor',
                                       'version_raw_value',
                                   ],
                                   description='rdp meta features.')
    return res


def extract(machine, args):
    res = []
    protocol = 'rdp'
    ports = [p for c in ports_and_protocols
             if c[0] == protocol
             for p in c[1]]
    for port in sorted(ports, reverse=True):
        field_prefix = 'p{}_{}_banner'.format(port, protocol)

        res += enumerated_fields(machine, field_prefix)
        res += meta_features(machine, field_prefix)
        res += tls_f.extract(machine, args,
                             field_prefix,
                             'p{}_{}'.format(port, protocol))
    return res


